set charset utf8;
DROP TABLE IF EXISTS `activity`;
CREATE TABLE `activity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `activity_name` varchar(90) NOT NULL,
  `type` tinyint(1) unsigned NOT NULL,
  `params` text NOT NULL,
  `start_time` int(10) NOT NULL,
  `end_time` int(10) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `app_registrationid`;
CREATE TABLE `app_registrationid` (
  `member_id` int(10) unsigned NOT NULL,
  `platform` varchar(30) NOT NULL,
  `registrationid` varchar(60) NOT NULL,
  PRIMARY KEY (`member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `app_session`;
CREATE TABLE `app_session` (
  `id` varchar(60) NOT NULL,
  `member_id` int(10) unsigned NOT NULL,
  `last_update` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `app_smscode`;
CREATE TABLE `app_smscode` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mobile` varchar(30) NOT NULL,
  `code` varchar(30) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12182 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `bankcard`;
CREATE TABLE `bankcard` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `bank_type` tinyint(1) NOT NULL,
  `card_no` varchar(60) NOT NULL,
  `default` tinyint(1) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `cart`;
CREATE TABLE `cart` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `item_id` int(10) unsigned NOT NULL,
  `num` mediumint(8) unsigned NOT NULL,
  `selected` tinyint(1) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3366 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `cash`;
CREATE TABLE `cash` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `amount` decimal(20,2) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `consignee`;
CREATE TABLE `consignee` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `consignee` varchar(30) NOT NULL,
  `province_id` mediumint(8) unsigned NOT NULL,
  `city_id` mediumint(8) unsigned NOT NULL,
  `county_id` mediumint(8) unsigned NOT NULL,
  `address` varchar(255) NOT NULL,
  `zip` varchar(30) NOT NULL,
  `mobile` varchar(60) NOT NULL,
  `telephone` varchar(60) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `default` tinyint(1) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16175 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `coupon`;
CREATE TABLE `coupon` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) NOT NULL,
  `coupon_name` varchar(255) NOT NULL,
  `memo` varchar(255) NOT NULL,
  `gen_num` int(11) unsigned NOT NULL,
  `value` decimal(20,2) unsigned NOT NULL,
  `expiry` text NOT NULL,
  `condition` text NOT NULL,
  `status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `coupon_user`;
CREATE TABLE `coupon_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `coupon_id` int(10) unsigned NOT NULL,
  `memo` varchar(255) NOT NULL,
  `deadline` int(10) unsigned NOT NULL,
  `get_time` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=45949 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `cron`;
CREATE TABLE `cron` (
  `id` smallint(4) unsigned NOT NULL AUTO_INCREMENT,
  `available` tinyint(1) unsigned NOT NULL,
  `name` varchar(30) NOT NULL,
  `last_run` int(10) unsigned NOT NULL,
  `next_run` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`,`available`),
  UNIQUE KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `envelope`;
CREATE TABLE `envelope` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mch_billno` varchar(28) NOT NULL,
  `member_id` int(10) unsigned NOT NULL,
  `money` decimal(20,2) NOT NULL,
  `err_msg` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mch_billno` (`mch_billno`)
) ENGINE=MyISAM AUTO_INCREMENT=4784 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `envelope_from`;
CREATE TABLE `envelope_from` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) unsigned NOT NULL COMMENT '总计划id',
  `from` int(11) unsigned NOT NULL COMMENT '来源  1 订单 2 注册 3刮刮卡',
  `from_id` varchar(60) NOT NULL DEFAULT '0' COMMENT '来源订单 如果是注册 为0 ',
  `money` decimal(20,2) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=68 DEFAULT CHARSET=utf8 COMMENT='红包来源表';
DROP TABLE IF EXISTS `envelope_log`;
CREATE TABLE `envelope_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mch_billno` varchar(28) NOT NULL,
  `member_id` int(10) unsigned NOT NULL,
  `money` decimal(20,2) NOT NULL,
  `err_msg` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mch_billno` (`mch_billno`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `envelope_schedule`;
CREATE TABLE `envelope_schedule` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL COMMENT '用户id',
  `send_money` mediumint(8) NOT NULL DEFAULT '0' COMMENT '需发送金额',
  `send_time` int(10) NOT NULL DEFAULT '0' COMMENT '下一次发送时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='发送红包计划表';
DROP TABLE IF EXISTS `envelope_scheme`;
CREATE TABLE `envelope_scheme` (
  `member_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `total_money` decimal(10,2) unsigned NOT NULL COMMENT '总金额',
  `sent_num` int(11) unsigned NOT NULL COMMENT '发送次数 ',
  `sent_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '已发送金额',
  PRIMARY KEY (`member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='发送红包总计划表';
DROP TABLE IF EXISTS `favorite`;
CREATE TABLE `favorite` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `type` tinyint(1) unsigned NOT NULL,
  `dataid` int(10) unsigned NOT NULL,
  `title` varchar(255) NOT NULL,
  `image` text NOT NULL,
  `params` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6192 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `funds`;
CREATE TABLE `funds` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `related_account` varchar(90) NOT NULL,
  `order_id` varchar(60) NOT NULL,
  `type` tinyint(2) unsigned NOT NULL COMMENT '0:提现;1:门店提成;2:城市合伙人提成;',
  `desc` varchar(255) NOT NULL,
  `money` decimal(20,2) NOT NULL,
  `params` text NOT NULL,
  `auth` tinyint(1) NOT NULL,
  `memo` varchar(255) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2547 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `image`;
CREATE TABLE `image` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `path` text NOT NULL,
  `url` text NOT NULL,
  `size` varchar(30) NOT NULL,
  `from` varchar(30) NOT NULL,
  `tag` varchar(255) NOT NULL,
  `thumb` tinyint(1) NOT NULL,
  `thumb_width` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(4) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `from` (`from`)
) ENGINE=MyISAM AUTO_INCREMENT=81677 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `mail`;
CREATE TABLE `mail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL,
  `type` tinyint(1) unsigned NOT NULL COMMENT '0:邮箱绑定',
  `email` varchar(60) NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=265 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `owner_id` int(10) unsigned NOT NULL,
  `referee_id` int(10) unsigned NOT NULL,
  `group` tinyint(2) unsigned NOT NULL,
  `role` varchar(30) NOT NULL,
  `region_id` mediumint(8) unsigned NOT NULL,
  `province_id` mediumint(8) unsigned NOT NULL,
  `city_id` mediumint(8) unsigned NOT NULL,
  `account` varchar(90) NOT NULL,
  `openid` varchar(90) NOT NULL,
  `code` varchar(5) NOT NULL,
  `bank` varchar(30) NOT NULL,
  `bankcard` varchar(30) NOT NULL,
  `password` varchar(60) NOT NULL,
  `salt` char(4) NOT NULL,
  `balance` decimal(20,2) unsigned NOT NULL,
  `point` mediumint(8) unsigned NOT NULL,
  `sale` decimal(20,2) unsigned NOT NULL,
  `consumption` decimal(20,2) unsigned NOT NULL,
  `referee_count` mediumint(8) unsigned NOT NULL,
  `order_count` mediumint(8) unsigned NOT NULL,
  `email` varchar(60) NOT NULL,
  `privileges` text NOT NULL,
  `real_auth` tinyint(1) unsigned NOT NULL,
  `wx_auth` tinyint(1) unsigned NOT NULL,
  `subscribe` tinyint(1) unsigned NOT NULL,
  `register_time` int(10) unsigned NOT NULL,
  `register_ip` varchar(30) NOT NULL,
  `last_login` int(10) unsigned NOT NULL,
  `deadline` int(10) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=85502 DEFAULT CHARSET=utf8;
